import './App.css';
import Todo from './components/Todo';
import {Component} from 'react';

const todos = [
  {
    id: 1, 
    name: "todo1",
    completed: false
  },
  {
    id: 2, 
    name: "todo2",
    completed: false
  }
];

class App extends Component {

  constructor(props){
    super(props);

  }

  handleCheckboxToggle = (id) => {
    console.log('checkbox changed', id);
  }

  render(){
    return (
      <div className="App">
        {todos.map(todo => (
          <Todo todo={todo} checkboxHandler={this.handleCheckboxToggle} />
        ))}

        {/* {todos.map(function(todo) {
          return <Todo />
        })} */}
      </div>
    );
  }
}  

export default App;
